import React from 'react'

const Navigation = () => {
  return (
    <>
    <Logo></Logo>
    <Sidenav></Sidenav>
    <Search></Search>
    <Textnav></Textnav>
    </>
  )
}

let Search =()=>{

  return(
    <>
    <input type="submit"/>
    <input type="text" placeholder="Search products"/>
    </>
  )
}


let Logo =()=>{

  return(
    <div className="logo">
     <img src="" alt="" className="logo-image"/>
    </div>
  )
}
let Sidenav =()=>{

  return(
    <div className="navbar">
      <img src="./images/love-ash.png" alt="" style={{height : '200px'}} className="nav-image"/>
      <div className="redsapce"></div>
      <img src="" alt="" className="nav-image"/>
      <div className="redsapce"></div>
      <img src="" alt="" className="nav-image"/>
      <div className="redsapce"></div>
    </div>
  )
}

let Textnav =()=>{


  return(
     <>
         <div className="textnav">
           <button className="nav-btn"></button>
           <button className="nav-btn"></button>
           <button className="nav-btn"></button>
         </div>
     </>
  )
}

export default Navigation
